import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
import './inin.css';
import './AdminDash.css';
import SideBar from './SideNav';
import {Button,Row,Col,Card,Container,Form} from 'react-bootstrap';

const gridExamplesPage = () => {
  return (
      <div>
           <SideBar />
          <MDBContainer>
      <MDBRow>
        <MDBCol> <Card style={{ width: '17rem', height: '8rem' }}>
                                    <Row style={{ width: '15rem', height: '8rem' }}>
                                        <Col>
                                            <Card.Img className="center" variant="left" src={student} style={{ width: '80%' }} />
                                        </Col>
                                        <Col>
                                            <Card.Body class="center-text">
                                                <Card.Title class="lead h1" style={{ color: 'deepskyblue', textAlign: "center" }}>18</Card.Title>
                                                <Card.Title class="lead text-center" style={{ color: '#000' }}>STUDENTS</Card.Title>
                                            </Card.Body>
                                        </Col>
                                    </Row>
                                </Card></MDBCol>
        <MDBCol>col</MDBCol>
        <MDBCol>col</MDBCol>
        <MDBCol>col</MDBCol>
      </MDBRow>
      <MDBRow>
        <MDBCol size="8">col-8</MDBCol>
        <MDBCol size="4">col-4</MDBCol>
      </MDBRow>
    </MDBContainer>
      </div>
    
  );
}

export default gridExamplesPage;
